import React from 'react'
import BankingSection from "../../BankingSection";
import photoFirst from '../../Images/Banner-millennia.png'

 const homeObjOne = {
    lightBackground:false,
    mainText:"Excellent Service",
    lightContents:true,
    lightTextDescription:true,
    headerLine:"Unlimited Transaction without any fee",
    description:"Get access to our special proposal that will help you to get unlimited transaction without getting any fee within the using term",
    buttonStyleManagement:"Start Journey",
    imageContents:'',
    alt:"logo",
    imageSource: {photoFirst}
}

const Home = () => {
    return(
        <>
        <BankingSection {...homeObjOne}/>
        </>
    )
}


export default Home
